import React from "react";
import "..CSS/Groups";
import LogoAndTitle from "../Components/LogoAndTitle";

function Groups() {
  return (
    <div className="Login">
      <header className="Login-Header">
        <LogoAndTitle />
      </header>
    </div>
  );
}

export default Groups;
